def interpolate_points(p1, p2, steps):
    return [
        (
            p1[0] + (p2[0] - p1[0]) * i / steps,
            p1[1] + (p2[1] - p1[1]) * i / steps
        )
        for i in range(steps + 1)
    ]


def parse_path(d):
    commands = re.findall(r'([MLHVCSQTAZ])([^MLHVCSQTAZ]*)', d.upper())
    coordinates = []
    current_pos = (0, 0)
    for command, params in commands:
        params = [float(x) for x in re.findall(r'-?\d+\.?\d*', params)]
        if command == 'M':
            coordinates.append((params[0], params[1]))
            current_pos = (params[0], params[1])
        elif command == 'L':
            for i in range(0, len(params), 2):
                new_pos = (params[i], params[i + 1])
                coordinates.append(new_pos)
                current_pos = new_pos
    return coordinates


def calculate_path_length(coordinates):
    length = 0
    for i in range(1, len(coordinates)):
        dx = coordinates[i][0] - coordinates[i - 1][0]
        dy = coordinates[i][1] - coordinates[i - 1][1]
        length += math.sqrt(dx ** 2 + dy ** 2)
    return length


def svg_path_to_png(svg_string, size=(1422, 779)):
    root = ET.fromstring(svg_string)
    img = Image.new('RGBA', size, color=(255, 255, 255, 0))
    draw = ImageDraw.Draw(img)

    for path in root.findall('.//{http://www.w3.org/2000/svg}path'):
        d = path.get('d')
        stroke = path.get('stroke', 'black')
        stroke_width = int(float(path.get('stroke-width', '1')))
        coordinates = parse_path(d)
        path_length = calculate_path_length(coordinates)

        if path_length > 100:  # 긴 선에만 보간점 추가
            interpolated_coords = []
            for i in range(1, len(coordinates)):
                interpolated_coords.extend(
                    interpolate_points(coordinates[i - 1], coordinates[i], int(stroke_width / 2))
                )
            coordinates = interpolated_coords

        if len(coordinates) > 1:
            # 선 그리기
            draw.line(coordinates, fill=stroke, width=stroke_width, joint="curve")

            # 긴 선에만 점 그리기
            if path_length > 100:
                for x, y in coordinates[::int(stroke_width / 2)]:  # 선 두께에 따라 점 간격 조절
                    draw.ellipse(
                        [x - stroke_width / 4, y - stroke_width / 4, x + stroke_width / 4, y + stroke_width / 4],
                        fill=stroke
                    )

    # 임시 디렉토리에 PNG 파일 저장
    with tempfile.TemporaryDirectory() as temp_dir:
        temp_file_name = f"{uuid.uuid4()}.png"
        temp_file_path = os.path.join(temp_dir, temp_file_name)

        img = Image.new('RGBA', size, color=(255, 255, 255, 0))
        draw = ImageDraw.Draw(img)

        # SVG 변환 로직 (기존 코드와 동일)

        # 가우시안 블러 필터 적용
        img = img.filter(ImageFilter.GaussianBlur(radius=0.5))

        # 임시 파일로 이미지 저장
        img.save(temp_file_path, format='PNG')

        with open(temp_file_path, "rb") as file:
            uploaded_file = client.files.create(
                file=file,
                purpose="vision"
            )
        return uploaded_file


